          code: 'SAVE20',
        },
        {
          title: '$10 Off Any Item',
          description: 'Save $10 on any single item in the store',
          code: 'DISCOUNT10',
        },
        // Add more coupons as needed
      ];

    return (
        <div className="rewards">
            <h1>Available Rewards</h1>
            <AvailableRewards coupons={rewards}/>
        </div>
    );
}
